import Image from 'next/image';

function Nav() {
	return (
		<nav className="w-full flex items-center justify-between py-35">
			<div className="mainLogo w-1/4 bg-pink-100">
				<Image
					src="/transparenta-logo.svg"
					alt="Transparenta Logo"
					layout="intrinsic"
					width="350px"
					height="28.16px"
				/>
			</div>
		</nav>
	);
}

export default Nav;
